[{"location":"index.html","page":"Home","title":"Home","text":"CurrentModule = EntropicTree","category":"page"},{"location":"index.html#EntropicTree","page":"Home","title":"EntropicTree","text":"","category":"section"},{"location":"index.html","page":"Home","title":"Home","text":"Documentation for EntropicTree.","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"","category":"page"},{"location":"index.html","page":"Home","title":"Home","text":"Modules = [EntropicTree]","category":"page"},{"location":"index.html#EntropicTree.find_subset","page":"Home","title":"EntropicTree.find_subset","text":"find_subset(n::Int64,p,q,RV::AbstractString=\"X\")\n\nGiven i and j compute Κ ⊆ 𝒩 \\{i,j}; i.e., all non exclusive subsets. i,j can also be empty (i.e. []), in which case the non-empty superset gets listed. An optional prefix can be added (default is X).  \n\nExamples\n\njulia>find_subset(4,1,3,\"X\")\n[\"\" \"X1\" \"X1,X2\" \"X1,X2,X5\" \"X1,X5\" \"X2\" \"X2,X5\" \"X5\"]\n\njulia>find_subset(4,1,3,\"\")\n[\"\" \"1\" \"1,2\" \"1,2,5\" \"1,5\" \"2\" \"2,5\" \"5\"]\n\njulia> find_subset(5,4,3,\"🍒\")\n[\"\" \"🍒3\" \"🍒3,🍒4\" \"🍒4\"]\n\njulia> find_subset(5,[],[],\"🍓\")\n[\"🍓1\" \"🍓1,🍓2\" \"🍓1,🍓2,🍓3\" \"🍓1,🍓3\" \"🍓2\" \"🍓2,🍓3\" \"🍓3\"]\n\n\n\n\n\n","category":"function"}]
